     WHERE (AREA IN ('', '전국', '광주광역시') AND DISTRICT IN ('', '북구')) AND (MIN_AGE IS NULL OR MIN_AGE <= 52) AND (MAX_AGE IS NULL OR MAX_AGE >= 52) AND GENDER LIKE '%남자%' AND PERSONAL_CATEGORY LIKE '%초등학생%' AND HOUSEHOLD_CATEGORY LIKE '%해당사항 없음%' AND BENEFIT_CATEGORY LIKE '%장애인%' AND (END_DATE IS NULL OR END_DATE > CURRENT_DATE());

